const BIKE_TYPE = {
    1: 'Xe đạp đơn thường',
    2: 'Xe đạp đơn điện',
    3: 'Xe đạp đôi thường',
    4: 'Xe đạp đôi điện'
}

const DEPOSIT_TYPE = {
    1: 400000,
    2: 550000,
    3: 700000,
    4: 800000
}

export {
    BIKE_TYPE, DEPOSIT_TYPE
}
